import {gql} from '@apollo/client'

export const AIRING_NOW = gql`
{
  Page(page: 1, perPage: 50){
    pageInfo{
      lastPage
    }
    media(type: ANIME, isAdult: false, season: SPRING, seasonYear: 2021){
      title{
        english
        romaji
      }
      genres
      description
      coverImage{
        medium 
        large
        extraLarge
      }
      studios{
        nodes{
          name
        }
      }
    }
  }
}
`
